import React from 'react';
import CartWidget from './CartWidget';

function NavBar() {
    return (
      <nav>
        <h2>Mi Tienda</h2>
        <ul>
  <li><a href="#inicio">Inicio</a></li>
  <li><a href="#productos">Productos</a></li>
  <li><a href="#contacto">Contacto</a></li>
</ul>

        <CartWidget />
      </nav>
    );
  }

  

export default NavBar;
